import React, { Component, Fragment } from "react";

import './header.css'

class Header extends Component 
{
    constructor()
    {
        super();
        this.state ={keyword:'Insert Text here'}
    }

     searchVal = (event) =>{
        console.log(event.target.value)
        this.props.userText(event.target.value);
    }

    render()
    {
        return(
            <React.Fragment>
                <header>
                <div className="collapse navbar-collapse" id="myNavbar">
                <ul className="nav navbar-nav">
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/products">Product</Link></li>
                    <li><Link to="/profile">Profile</Link></li>
                </ul>
                <ul className="nav navbar-nav navbar-right">
                    <li><Link to="/"><span className="glyphicon glyphicon-user"></span> Sign Up</Link></li>
                    <li><Link to="/"><span className="glyphicon glyphicon-log-in"></span> Login</Link></li>
                </ul>
                </div>
                <br/>
                <p className="Container" align="center">
                <span>search by Brand  </span>
                <input type="text" onChange={this.searchVal}></input>
                <div style={{color:'white',fontSize:'20px'}}>{this.state.keyword}</div>

            </p>
            <hr/>
            </header>
            </React.Fragment>
        )
    }

}

export default Header;
